import React from 'react';

export default class Post extends React.Component {
    render() {
        return (
            <div>
                <div>ID: {this.props.id}</div>
                <div>Content: {this.props.text}</div>
                <div>Date: {this.props.creationDateTime}</div>
                <div>Likes: {this.props.likes}</div>
            </div>
        )
    }
}
